    "2014-09-17T17:56:22.519796",nt"name": "aerial-photography-and-imagery-ortho-corrected-2009-digital-orthophotos-charlotte-county",nt"isopen":
    false,nt"url": null,nt"notes": "The 8-bit 4-Band (Red, Green, Blue, Near
    Infrared) one-foot orthophotos to be mapped consists of 3,849 cells (approximately
    3,452 square miles) flown with a Z/I Intergraph DMC airborne digital sensor. The
    flight season was from December 15, 2008 through March 15, 2009. The flight dates
    are as follows: December 7, 2008; December 8, 2008; December 13, 2008; December
    16, 2008; December 17, 2008; December 30, 2008; January 1, 2009; January 3, 2009;
    and January 16, 2009. All images were collected between 10:00 AM to 2:30 PM to minimize
    shadows. All images were obtained under cloud free conditions. With an RMSE of 2.61
    feet at the 95% confidence interval (1.51 feet RMSE), the RMSE meets and exceeds
    the specified horizontal accuracy of 7.6 feet at the 95% confidence interval (4.4
    feet RMSE). The project title is FY 2009 Digital Orthophoto (B089). The Purchase
    Order number is 09POSOW0201. The Work Order Name is Southwest District One-Foot
    Orthophoto. The Work Order Number is 3. The Project managers are April Davis with
    the District and Gary Florence with the Consultant. The Consultant is GMR Aerial
    surveys, Inc. dba Photo Science.",nt"license_title": null,nt"extras": [{ntt"key":
